import React from "react";

const RecOptions = (props) => {
  return (
    <>
      props.medicine.map((med,i) =>
      {
        <>
          <input type="checkbox" id={i} name={med} value={med} />
          <label for={i}>{med}</label>
        </>
      }
      )
    </>
  );
};

export default RecOptions;
